import React, { Suspense } from 'react';
const SignInComponent = React.lazy(() => import('./views/loginManager/sign-in/signIn'));
const DashboardComponent = React.lazy(() => import('./views/dashboard/dashboard'));
// import Dashboard from './views/dashboard/dashboard'
// import SignIn from './views/loginManager/sign-in/signIn'
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
// import { Container, Row, Col } from 'react-bootstrap';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Suspense fallback={<div>Loading...</div>}>
      <Router>
        <div className="Layout">
          <Switch>
            <Route path="/web/dashboard">
              <DashboardComponent />
            </Route>
            <Route path="/">
              <SignInComponent />
            </Route>
          </Switch>
        </div>
      </Router>
    </Suspense>
  );
}

export default App;
